// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract PumlxStaking is ERC721Holder, ReentrancyGuard, Ownable, Pausable {
    using SafeERC20 for IERC20;

    /* ========== STATE VARIABLES ========== */

    IERC20 public pumlxToken;
    IERC721 public stakingToken;
    uint256 public rewardRate = 10;
    uint256 public lastUpdateTime;
    uint256[] public stakeData;

    mapping(address => uint256) public userLastUpdateTime;
    mapping(address => uint256) public userRewardStored;
    mapping(address => uint256) public userLastReward;
    mapping(address => uint256) public userRewardPaid;

    uint256 public totalSupply;
    uint256 public totalSupplyNFT;
    mapping(address => uint256) public balances;
    mapping(address => uint256) public balancesNFT;
    mapping(uint256 => address) public stakedAssets;

    /* ========== CONSTRUCTOR ========== */

    constructor(address _stakingToken) {
        pumlxToken = IERC20(0xbc75ECc12c77506DCFd70113B15683A9a0768AB4);
        stakingToken = IERC721(_stakingToken);
    }

    /* ========== VIEWS ========== */

    function lastTimeRewardApplicable() public view returns (uint256) {
        return block.timestamp;
    }

    function userUpdateTime(address account) public view returns (uint256) {
        return userLastUpdateTime[account];
    }

    function rewardPerUser(address account, uint256 feeward) public view returns (uint256) {
        if (totalSupply == 0) {
            return userRewardStored[account];
        } else {
            return
                userRewardStored[account] +
                ((lastTimeRewardApplicable() - userLastUpdateTime[account]) * (rewardRate / 86440) * 1e18 * balances[account]) +
                (feeward * balances[msg.sender] / totalSupply);
        }
    }

    function rewardPerUserNFT(address account) public view returns (uint256) {
        return
            userRewardStored[account] +
            ((lastTimeRewardApplicable() - userLastUpdateTime[account]) * (rewardRate / 86440) * 1e18 * balances[account]);
    }

    function getRewardStored(address account) public view returns (uint256) {
        return userRewardStored[account];
    }

    function getLastReward(address account) public view returns (uint256) {
        return userLastReward[account];
    }

    function getRewardPaid(address account) public view returns (uint256) {
        return userRewardPaid[account];
    }

    function balanceOfPumlx(address account) public view returns (uint256) {
        return balances[account];
    }

    function balanceOfNft(address account) public view returns (uint256) {
        return balancesNFT[account];
    }

    function getData(address account) public returns (uint256[] memory) {
        stakeData.push(userLastUpdateTime[account]);
        stakeData.push(userRewardStored[account]);
        stakeData.push(userLastReward[account]);
        stakeData.push(userRewardPaid[account]);
        stakeData.push(balances[account]);
        stakeData.push(balancesNFT[account]);

        return stakeData;
    }


    /* ========== MUTATIVE FUNCTIONS ========== */

    function stake(uint256 amount, uint256 feeward) external nonReentrant whenNotPaused updateReward(msg.sender, feeward) {
        require(amount > 0, "Staking: No pumlx provided");

        pumlxToken.safeTransfer(msg.sender, amount);
        _stake(amount);
        emit Staked(msg.sender, amount);
    }

    function withdraw(uint256 amount, uint256 feeward) public nonReentrant updateReward(msg.sender, feeward) {
        require(amount > 0, "Staking: No pumlx provided");
        require(amount < balances[msg.sender], "Staking: much withdraw");

        pumlxToken.safeTransferFrom(address(this), msg.sender, amount);
        _withdraw(amount);

        emit Withdrawn(msg.sender, amount);
    }

    /// @notice Stakes user's NFTs
    /// @param tokenIds The tokenIds of the NFTs which will be staked
    function stakeNFT(uint256[] memory tokenIds) external nonReentrant whenNotPaused updateRewardNFT(msg.sender) {
        require(tokenIds.length != 0, "Staking: No tokenIds provided");

        uint256 amount;
        for (uint256 i = 0; i < tokenIds.length; i += 1) {
            // Transfer user's NFTs to the staking contract
            stakingToken.safeTransferFrom(msg.sender, address(this), tokenIds[i]);
            // Increment the amount which will be staked
            amount += 1;
            // Save who is the staker/depositor of the token
            stakedAssets[tokenIds[i]] = msg.sender;
        }
        _stakeNFT(amount);
        emit StakedNFT(msg.sender, amount, tokenIds);
    }

    /// @notice Withdraws staked user's NFTs
    /// @param tokenIds The tokenIds of the NFTs which will be withdrawn
    function withdrawNFT(uint256[] memory tokenIds) public nonReentrant updateRewardNFT(msg.sender) {
        require(tokenIds.length != 0, "Staking: No tokenIds provided");

        uint256 amount;
        for (uint256 i = 0; i < tokenIds.length; i += 1) {
            // Check if the user who withdraws is the owner
            require(
                stakedAssets[tokenIds[i]] == msg.sender,
                "Staking: Not the staker of the token"
            );
            // Transfer NFTs back to the owner
            stakingToken.safeTransferFrom(address(this), msg.sender, tokenIds[i]);
            // Increment the amount which will be withdrawn
            amount += 1;
            // Cleanup stakedAssets for the current tokenId
            stakedAssets[tokenIds[i]] = address(0);
        }
        _withdrawNFT(amount);

        emit WithdrawnNFT(msg.sender, amount, tokenIds);
    }

    function getReward(uint256 reward, uint256 feeward) public nonReentrant updateReward(msg.sender, feeward) {

        require(userRewardStored[msg.sender] > reward, "Rewards wanted too much");

        if (reward > 0) {
            pumlxToken.safeTransfer(msg.sender, reward);
            userRewardStored[msg.sender] -= reward;
            userLastReward[msg.sender] = reward;
            userRewardPaid[msg.sender] += reward;

            emit RewardPaid(msg.sender, reward);
        }
    }

    function _stake(uint256 _amount) internal {
        totalSupply += _amount;
        balances[msg.sender] += _amount;
    }

    function _withdraw(uint256 _amount) internal {
        totalSupply -= _amount;
        balances[msg.sender] -= _amount;
    }

    function _stakeNFT(uint256 _amount) internal {
        totalSupplyNFT += _amount;
        balancesNFT[msg.sender] += _amount;
    }

    function _withdrawNFT(uint256 _amount) internal {
        totalSupplyNFT -= _amount;
        balancesNFT[msg.sender] -= _amount;
    }

    /* ========== RESTRICTED FUNCTIONS ========== */

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    /* ========== MODIFIERS ========== */

    modifier updateReward(address account, uint256 feeward) {
        if (account != address(0)) {
            userRewardStored[account] = rewardPerUser(account, feeward);
            lastUpdateTime = lastTimeRewardApplicable();
            userLastUpdateTime[account] = lastTimeRewardApplicable();
        }
         _;
    }

    modifier updateRewardNFT(address account) {
        if (account != address(0)) {
            userRewardStored[account] = rewardPerUserNFT(account);
            lastUpdateTime = lastTimeRewardApplicable();
            userLastUpdateTime[account] = lastTimeRewardApplicable();
        }
        _;
    }

    /* ========== EVENTS ========== */


    event Staked(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event RewardPaid(address indexed user, uint256 reward);

    event StakedNFT(address indexed user, uint256 amount, uint256[] tokenIds);
    event WithdrawnNFT(address indexed user, uint256 amount, uint256[] tokenIds);
}
